import './App.css';
import { Spinner } from 'reactstrap';

function App() {
  return (
    <div style={{textAlign: 'center'}}>
    <div className="App" style={{ marginTop: '40vh', fontSize: '2em'}}>
      <Spinner size="sm" color="secondary" />
    </div>
    <p><em>christopher robin reynolds</em></p>
    </div>
  );
}

export default App;
